import { setUseProxies } from "immer";
import React,{useState} from "react";
import './Form.css';



function ToDoList()
{
    const [user, setUser] = useState('');
    const [data,setData] = useState([]);

    const handleSubmit =()=>{
    setData ([...data,user]);
    setUser("");
    }

    const obj = [
        {
            "id":"1",
            "status":"good",
            "title":"bad"
        },

        {
            "id":"2",
            "status":"good",
            "title":"bad"
        },

        {

            "id":"3",
            "status":"good",
            "title":"bad"

        },

        {
            "id":"4",
            "status":"good",
            "title":"bad"
        }
    ]



    return(
        <div style={{paddingTop:'90px'}}>

