          <TextField  onChange={(e)=>setUser(e.target.value)} sx={{ m: 1, minWidth: 400 }} placeholder='Name' />
        </div>

        <div>

        <div className='body' >
          <Button onClick={handleSubmit} sx={{ m: 1, minWidth: 400 }}  variant="contained">Submit </Button>
        </div>

        <div style={{paddingLeft:'400px',paddingTop:'50px'}}>

        {data.map((data,key) => (
        <div key={key}>
            <li>{data}</li>
            <Button sx={{ m: 1, minWidth: 100 }}  variant="contained">Edit</Button>
            <Button sx={{ m: 1, minWidth: 100 }}  variant="contained">Complete</Button>
            <Button sx={{ m: 1, minWidth: 100 }}  variant="contained">Cancel</Button>
        </div> ))}

        </div>
        </div>

        <div>

        </div>







        </div>
    )
}

export default ToDoList;
